import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom';
import Login from './pages/login/index';
import CadastroEmpresa from './pages/CadastroEmpresa/index';
import PerfilEmpresa from './pages/PerfilEmpresa';
import VagasEmpresa from './pages/VagasEmpresa';
import DetalhesVaga from './pages/DetalhesVagaEmpresa';
import CadastrarVagas from './pages/CadastrarVagas';
import Perfil from './pages/perfil';
import CadastroAluno from './pages/cadastroAluno';
import DetalhesVagaEmpresa from './pages/DetalhesVagaEmpresa';

function Routers() {
    return (
        <BrowserRouter>
            <Route path="/" exact component={Login} />
            <Route path="/CadastroEmpresa" component={CadastroEmpresa} />
            <Route path="/PerfilEmpresa" component={PerfilEmpresa} />
            <Route path="/VagasEmpresa" component={VagasEmpresa} />
            <Route path="/DetalhesVagaEmpresa" component={DetalhesVagaEmpresa}/>
            <Route path="/detalhesAluno" component={DetalhesVaga} />
            <Route path="/cadastroAluno" component={CadastroAluno} />
            <Route path="/perfil" component={Perfil} />

        </BrowserRouter>
    );
}
export default Routers;
